// src/components/ExpenseForm.jsx
import React, { useState } from 'react';
import { expensesService } from '../services/api';
import { saveToLocalStorage, getFromLocalStorage } from '../utils/localStorageUtils';

export const ExpenseForm = ({ onAddExpense }) => {
  const [formData, setFormData] = useState({
    amount: '',
    category: '',
    description: '',
    date: new Date().toISOString().split('T')[0]
  });

  const [isSubmitting, setIsSubmitting] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setError(null);

    const expenseData = {
      ...formData,
      amount: parseFloat(formData.amount),
      id: Date.now().toString(), // ID temporal para sincronización
    };

    try {
      if (navigator.onLine) {
        // Si está online, guardar directamente en la base de datos
        const savedExpense = await expenseService.create(expenseData);
        onAddExpense(savedExpense);
      } else {
        // Si está offline, guardar en localStorage
        const pendingExpenses = getFromLocalStorage('pendingExpenses') || [];
        pendingExpenses.push(expenseData);
        saveToLocalStorage('pendingExpenses', pendingExpenses);
        onAddExpense(expenseData);
      }

      // Limpiar formulario
      setFormData({
        amount: '',
        category: '',
        description: '',
        date: new Date().toISOString().split('T')[0]
      });
    } catch (err) {
      setError('Error al guardar el gasto. Se guardará localmente.');
      // Si falla la conexión, guardar en localStorage
      const pendingExpenses = getFromLocalStorage('pendingExpenses') || [];
      pendingExpenses.push(expenseData);
      saveToLocalStorage('pendingExpenses', pendingExpenses);
      onAddExpense(expenseData);
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-4">
      {error && (
        <div className="bg-red-50 p-4 rounded-lg">
          <p className="text-red-600">{error}</p>
        </div>
      )}

      <div>
        <label className="block mb-2">Monto</label>
        <input
          type="number"
          name="amount"
          value={formData.amount}
          onChange={handleChange}
          className="w-full p-2 border rounded"
          required
          min="0"
          step="0.01"
        />
      </div>

      <div>
        <label className="block mb-2">Categoría</label>
        <select
          name="category"
          value={formData.category}
          onChange={handleChange}
          className="w-full p-2 border rounded"
          required
        >
          <option value="">Seleccionar categoría</option>
          <option value="alimentación">Alimentación</option>
          <option value="transporte">Transporte</option>
          <option value="vivienda">Vivienda</option>
          <option value="servicios">Servicios</option>
          <option value="educación">Educación</option>
          <option value="entretenimiento">Entretenimiento</option>
          <option value="salud">Salud</option>
          <option value="otros">Otros</option>
        </select>
      </div>

      <div>
        <label className="block mb-2">Descripción</label>
        <input
          type="text"
          name="description"
          value={formData.description}
          onChange={handleChange}
          className="w-full p-2 border rounded"
        />
      </div>

      <div>
        <label className="block mb-2">Fecha</label>
        <input
          type="date"
          name="date"
          value={formData.date}
          onChange={handleChange}
          className="w-full p-2 border rounded"
          required
        />
      </div>

      <button
        type="submit"
        disabled={isSubmitting}
        className={`w-full p-2 text-white rounded ${
          isSubmitting 
            ? 'bg-gray-400 cursor-not-allowed' 
            : 'bg-blue-500 hover:bg-blue-600'
        }`}
      >
        {isSubmitting ? 'Guardando...' : 'Guardar Gasto'}
      </button>
    </form>
  );
};

export default ExpenseForm;
